import React from 'react'
import { useState, useEffect } from 'react'
import './Deadlinever3.css'
import PropTypes from 'prop-types'



GetDeadline.propTypes = {
    deadine:PropTypes.array,

};

GetDeadline.defaultProps={
    deadine:[],
};


function GetDeadline(props){
    const {deadine} = props;

    return(
        <div className='containe'>
        <h1>Responsoi Cards</h1>
        <div className='cards'>
        {deadine.map(post =>(
    
            <div className='card'>
             <h2>
             disciplineId__disc_name : {post.disciplineId__disc_name}
            </h2>
            <p>
            description: {post.description}
            </p>
            
        <input type='checkbox' /> deadline: {post.deadline}
           <button className='btn'>Done</button>
          


            </div>
            
        ))}
</div>
        </div>
    )
}

export default GetDeadline
